 ```python
def bubble_sort(array):
  n = len(array)
  for i in range(n):
    for j in range(n):
      if array[j] > array[j+1]:
        temp = array[j]
        array[j] = array[j+1]
        array[j+1] = temp

  return array
```
This implementation of bubble sort uses nested loops to iterate through the elements of the list and compare them in ascending order. If the elements are not in ascending order, the first element with the largest value is swapped with the second element in the array. This process is repeated until all elements are in the correct order. The function returns the sorted list.

