 Sure! Here is a simple C++ program that reads network packets from a socket on port 888:
```
#include <iostream>
#include <cstring>
#include <arpa/inet.h>
#include <sys/socket.h>
#include <netinet/tcp.h>

int main()
{
    // Create a socket
    int sock = socket(AF_INET, SOCK_STREAM, 0);

    // Connect to the server
    struct sockaddr_in servAddr;
    memset(&servAddr, 0, sizeof(servAddr));
    servAddr.sin_family = AF_INET;
    servAddr.sin_addr.s_addr = inet_addr("127.0.0.1"); // IP address of the loopback interface
    servAddr.sin_port = htons(888); // Port number to connect to
    connect(sock, (struct sockaddr *)&servAddr, sizeof(servAddr));

    // Read data from the socket
    char buffer[1024] = {0};
    size_t bytesRead = 0;
    while (bytesRead = recv(sock, buffer, sizeof(buffer), 0) > 0) // Read data from the socket
    {
        // Your code here
        std::cout << "Received packet: " << buffer << std::endl;
        // clean buffer
        memset(buffer, 0, sizeof(buffer));
    }

    // Close the socket
    close(sock);
    return 0;
}
```

